  `back_status` varchar(3) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '1' COMMENT '是否允许取回流程1是0否',
  `graphic_status` varchar(3) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '1' COMMENT '是否允许查看流程图1是0否',
  `auto_submit_status` varchar(3) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '是否启用自动提交流程1是0否',
  `notify_way` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '通知类型(多个会以逗号隔开)',
  `tenant_id` int(10) NULL DEFAULT NULL COMMENT '租户ID',
  `update_count` int(11) NULL DEFAULT NULL COMMENT 'mp乐观锁字段',
  `start_type` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '流程开始节点类型  applyEvent、 tableEvent、timerEvent、userEvent、subEvent、buttonEvent',
  `open_status` smallint(1) NULL DEFAULT 1 COMMENT '流程关闭状态 0 关闭1 开启（默认开启）',
  `run_concurrent_mode` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '并发运行方式 并行(默认）0、串行 1',
  `trigger_other_process` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '是否允许触发其他流程 0否  1允许',
  `error_notice_user_ids` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '流程异常通知人员，多个逗号分割',
  `error_notice_repeat` varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '流程异常通知频率',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_epros_process_type`(`process_type`) USING BTREE,
  INDEX `idx_epros_process_key`(`process_key`) USING BTREE,
  INDEX `idx_epros_low_app_id`(`low_app_id`) USING BTREE,
  INDEX `idx_epros_tenant_id`(`tenant_id`) USING BTREE,
  INDEX `idx_epros_process_name`(`process_name`) USING BTREE,
  INDEX `idx_epros_openstatus`(`open_status`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '流程设计表' ROW_FORMAT = Dynamic;

