-- ----------------------------
-- Table structure for low_app_template
-- ----------------------------
DROP TABLE IF EXISTS `low_app_template`;
CREATE TABLE `low_app_template`  (
  `id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键id',
  `title` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '标题',
  `sub_title` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '副标题',
  `category` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '类别',
  `industry` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '行业',
  `tag` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '模版标签',
  `cover_url` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '封面图',
  `introduce` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '模版详情介绍',
  `rotation_pics` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '模版详情轮播图',
  `video_url` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT '0' COMMENT '模版视频简介地址',
  `iz_publish` tinyint(1) NULL DEFAULT NULL COMMENT '针对审核完的模版，客户自主控制上架/下架（0-否，1-是）',
  `publish_time` datetime NULL DEFAULT NULL COMMENT '发布时间',
  `reject_cause` varchar(125) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '审核未通过原因',
  `status` tinyint(1) NULL DEFAULT NULL COMMENT '状态(0-草稿，1审核中, 2-审核通过,-1 未通过)',
  `bind_low_app_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '绑定应用id',
  `download_num` int(10) NULL DEFAULT 0 COMMENT '下载次数',
  `like_num` int(10) NULL DEFAULT 0 COMMENT '点赞次数',
  `rate_num` int(10) NULL DEFAULT 0 COMMENT '评分次数',
  `rate` int(10) NULL DEFAULT 0 COMMENT '综合评分',
  `free_status` tinyint(1) NULL DEFAULT 0 COMMENT '状态(0-免费，1收费)',
  `price` decimal(10, 2) NULL DEFAULT NULL COMMENT '定价',
  `del_flag` tinyint(1) NULL DEFAULT 0 COMMENT '删除状态(0-正常,1-已删除)',
  `tenant_id` int(10) NULL DEFAULT NULL COMMENT '租户id',
  `create_by` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '更新人',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `normal_low_app_template_title`(`title`) USING BTREE,
  INDEX `normal_low_app_template_status`(`status`) USING BTREE,
  INDEX `normal_low_app_template_tag`(`tag`) USING BTREE,
  INDEX `normal_low_app_template_industry`(`industry`) USING BTREE,
  INDEX `normal_low_app_template_category`(`category`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '应用模版表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of low_app_template
-- ----------------------------

